import React from 'react';
import { MenuItem } from '../';

import './Menu.css';

interface Props {
  items: {
    text: string;
    clicked: (t: string) => unknown;
  }[];
}

export const Menu = (props: Props) => {
  const { items } = props;

  const content = items.map((item, index) => {
    return <MenuItem key={index} text={item.text} clicked={item.clicked}/>
  });

  return (
    <section className="menu__container">
      { content }
    </section>
  );
}
